/** @jsx jsx */
import { css, jsx } from '@emotion/core';

const Card = ({ children }) => {
  return (
    <article
      css={css`
        width: 100%;
        min-height: 300px;
        border-radius: 5px;
        background: var(--black-light);
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
      `}>
      {children}
    </article>
  );
};

export default Card;
